import {AppBar,MuiThemeProvider ,TextField,RaisedButton} from 'material-ui';


class FormPersonalDetails extends Component {
    continue = e => {
        e.prevenDefault();
        this.props.nextStep();
    }
    back = e =>{
        e.prevenDefault();
        this.props.previosStep()
    }
    render() { 
        const {values,handleChange} = this.props;
        return ( 
            <MuiThemeProvider>
                    <React.Fragment>
                        <TextField 
                        hintText = "Enter The First Name"
                        floatingLabelText="First Name"
                        onChange = {handleChange('firstName')}
                        defaultValues = {values.firstName}/>
                        <br/>
                        <TextField 
                        hintText = "Enter The Last Name"
                        floatingLabelText="Last Name"
                        onChange = {handleChange('lastName')}
                        defaultValues = {values.firstName}/>
                        <br/>
                        <TextField 
                        hintText = "Enter The Email"
                        floatingLabelText="Email"
                        onChange = {handleChange('email')}
                        defaultValues = {values.email}/>
                        <br/>

                        <RaisedButton 
                        label = "Continue"
                        primary = {true}
                        style = {styles.button}
                        onClick = {this.continue}/>
                    </React.Fragment>
                    {/* <input type="text" values = {values.firstName} onChange ={handleChange('firstName')}/> */}
                </MuiThemeProvider>                
         );
    }
}
 
export default FormPersonalDetails;
